+TextReplacements=(Category=Game, bIsMinimalPatch=True, Namespace="FortSetting", Key="LicensedAudioTreatment_Description", NativeString="If you are a content creator, you can select this option to avoid playing licensed music from Emotes. This setting does not apply to event playlists that feature content that is licensed like concerts.\n\n<strong>Play</>: The audio is played normally (Default).\n\n<strong>Mute Others</>: When other players play emotes with licensed audio, the audio will be muted.\n\n<strong>Mute All</>: All emotes containing licensed audio will be muted if you or anyone plays them.", LocalizedStrings=(("ar","إذا كنت صانع محتوى، يمكنك تحديد هذا الخيار لتفادي تشغيل الموسيقى المحمية بحقوق النشر. لا يتم تطبيق هذا الخيار على قوائم فعاليات معينة تتضمن محتوى محمي بحقوق النشر مثل الحفلات..\n\n<strong>تشغيل</>: يتم تشغيل الصوت بشكل طبيعي (افتراضي).\n\n<strong>كتم صوت الآخرين</>: سيتم كتم الصوت عندما يستخدم اللاعبون الآخرون موسيقى محمية بحقوق النشر.\n\n<strong>كتم صوت الكل</>: سيتم كتم جميع الأصوات التي تحتوي على موسيقى محمية بحقوق النشر إذا ما قمت بتشغيلها أو شخص آخر."),("en","If you are a content creator, you can select this option to avoid playing licensed music. This setting does not apply to certain event playlists that feature content that is licensed like concerts.\n\n<strong>Play</>: The audio is played normally (Default).\n\n<strong>Mute Others</>: When other players play licensed audio, the audio will be muted.\n\n<strong>Mute All</>: All licensed audio will be muted if you or anyone plays them."),("de","Mit dieser Option kannst du verhindern, dass lizenzierte Musik abgespielt wird, was besonders nützlich für Content-Creators ist. Diese Einstellung hat keine Auswirkung auf bestimmte Event-Modi wie z. B. Konzerte, bei denen lizenzierte Inhalte vorkommen.\n\n<strong>Abspielen</>: Das Audio wird normal abgespielt (Standardeinstellung).\n\n<strong>Von anderen stumm schalten</>: Wenn andere Spieler lizenziertes Audio nutzen, wird es stumm geschaltet.\n\n<strong>Immer stumm schalten</>: Lizenziertes Audio wird immer stumm geschaltet, egal ob du oder jemand anderes es nutzt."),("es","Si eres un creador de contenido, puedes seleccionar esta opción para que no se reproduzcan sonidos con copyright. Esta opción no se aplica a ciertas colas de eventos en las que aparece contenido protegido por copyright, como en los conciertos, por ejemplo.\n\n<strong>Reproducir</>: El audio se reproduce con normalidad (predeterminado).\n\n<strong>Silenciar otros</>: Cuando otros jugadores utilicen sonidos con copyright, el audio no sonará.\n\n<strong>Silenciar todo</>: Todo sonido con copyright será silenciado, tanto si los utilizas tú como si lo hacen otros jugadores."),("es-419","Si eres creador de contenido, puedes seleccionar esta opción para evitar reproducir la música con licencia. Este ajuste no se aplica a ciertas listas de reproducción de eventos que incluyan contenido licenciado como, por ejemplo, conciertos.\n\n<strong>Reproducir</>: el sonido se reproduce normalmente (predeterminado).\n\n<strong>Silenciar a los demás</>: cuando los demás reproduzcan sonido licenciado, el audio se silenciará.\n\n<strong>Silenciar todo</>: todo sonido licenciado se silenciarán si tú o alguien más los reproduce."),("fr","Si vous êtes un créateur de contenu, vous pouvez sélectionner cette option afin d'éviter de jouer de la musique sous licence. Ce paramètre ne concerne pas certains événements du jeu qui contiennent du contenu sous licence tels que des concerts.\n\n<strong>Jouer</> : le son est joué de façon normale (Par défaut).\n\n<strong>Couper le son des autres</> : quand d'autres joueurs jouent de la musique sous licence, le son est coupé.\n\n<strong>Couper le son de tout le monde</> : la musique sous licence est coupée pour tout le monde, qu'elle soit jouée par vous ou par quelqu'un d'autre."),("it","Se sei un creatore di contenuti, puoi usare questa opzione per impedire la riproduzione di musiche su licenza. L'opzione non si applica ad alcune playlist evento con contenuti su licenza come i concerti.\n\n<strong>Riproduci</>: l'audio viene riprodotto normalmente (predefinito).\n\n<strong>Disattiva audio altri</>: l'audio viene disattivato quando altri giocatori usano audio su licenza.\n\n<strong>Disattiva audio tutti</>: l'audio viene disattivato quando tu o chiunque altro usate audio sul licenza."),("ja","コンテンツクリエイターはこのオプションを設定して、著作権で保護された曲を再生しないようにすることができます。この設定は、コンサートなどの著作権で保護されたコンテンツが含まれる特定のイベントプレイモードには適用されません。\n\n<strong>再生</>: 音声は通常どおり再生されます(デフォルト)。\n\n<strong>他のプレイヤーをミュート</>: 他のプレイヤーが著作権で保護されたオーディオを使用した場合、そのオーディオはミュートされます。\n\n<strong>全てをミュート</>: 自分を含む全プレイヤーによって使用される著作権で保護されたオーディオがミュートされます。"),("ko","콘텐츠 크리에이터인 경우, 이 옵션을 선택하여 라이선스가 적용된 음악을 재생하지 않도록 할 수 있습니다. 콘서트처럼 라이선스가 부여된 특정 이벤트 재생목록에서는 이 설정이 적용되지 않습니다.\n\n<strong>재생</>: 오디오가 정상적으로 재생됩니다.(기본)\n\n<strong>다른 플레이어 음소거</>: 다른 플레이어가 라이선스가 적용된 오디오를 재생하면 오디오가 음소거됩니다.\n\n<strong>전체 음소거</>: 본인 또는 다른 플레이어가 라이선스가 적용된 오디오를 재생하면 본인과 다른 플레이어의 오디오 모두 음소거됩니다."),("pl","Jeśli jesteś twórcą treści, możesz wybrać tę opcję, by uniknąć odtwarzania licencjonowanej muzyki. To ustawienie nie wpływa na niektóre tryby z wydarzeniami, które wykorzystują licencje, np. koncerty.\n\n<strong>Odtwarzaj</>: dźwięk odtwarzany jest normalnie (domyślnie).\n\n<strong>Wycisz innych</>: Dźwięk będzie wyciszony, kiedy objęte licencjami audio jest odtwarzane przez innych.\n\n<strong>Wycisz wszystkie</>: Dźwięk będzie wyciszony, kiedy objęte licencjami audio jest odtwarzane przez ciebie lub innych."),("pt-BR","Se você é um criador de conteúdo, pode selecionar esta opção para evitar reproduzir músicas licenciadas. Essa configuração não se aplica a determinadas listas de partidas de eventos com conteúdo licenciado, como shows.\n\n<strong>Reproduzir</>: O áudio é reproduzido normalmente (Padrão).\n\n<strong>Silenciar Outros</>: O áudio é silenciado quando outros jogadores reproduzem áudio licenciado.\n\n<strong>Silenciar Tudo</>: Todo áudio licenciado será silenciado se você ou alguém os reproduzir."),("ru","Авторы материалов могут воспользоваться этим параметром, чтобы отключить воспроизведение лицензированной музыки. Этот параметр не действует для некоторых режимов событий, где представлен лицензированный контент (например, на концертах).\n\n<strong>Воспроизводить</>: звук будет проигрываться как обычно (выбрано по умолчанию).\n\n<strong>Заглушать других</>: когда другие игроки будут воспроизводить лицензированный звук, его не будет слышно.\n\n<strong>Заглушать всех</>: воспроизведение лицензированной музыки отключено для всех игроков, включая вас."),("tr","İçerik üreticisiysen lisanslı müziklerin çalınmasını engelleme imkânın var. Bu ayar, konserler gibi lisanslı içeriklere yer veren belirli etkinlikler için geçerli değildir.\n\n<strong>Oynat</>: Sesler normal şekilde oynatılır.(Varsayılan Ayar)\n\n<strong>Diğerlerininkini Sustur</>: Diğer oyuncular lisanslı müzik kullandığında müzik susturulur.\n\n<strong>Herkesinkini Sustur</>: Lisanslı müziğin sesi kimin kullandığı fark etmeksizin susturulur."),("zh-CN","如果你是内容创作者，你可以选择此选项避免播放授权音乐。此设置不适用于包含类似音乐会的授权内容的活动部分游戏模式。\n\n<strong>播放</>：正常播放音频（默认）。\n\n<strong>使其他人静音</>：当其他玩家播放版权音频时，音频将会静音。\n\n<strong>全部静音</>：当你或任何人播放版权音频时，全部都会静音。"),("zh-Hant","如果你是內容創作者，你可以選擇此選項避免播放授權音樂。此設置不適用於包含類似音樂會的授權內容的活動部分遊戲模式。 \n\n<strong>播放</>：正常播放音頻（默認）。 \n\n<strong>使其他人靜音</>：當其他玩家播放版權音頻時，音頻將會靜音。 \n\n<strong>全部靜音</>：當你或任何人播放版權音頻時，全部都會靜音。")))
